import {AppContext} from '../../../App';

function ShowAssistBtn () {

    const context = useContext(AppContext);

    return (
        <button className="mdc-icon-button material-icons btns" 
                type="button" 
                title="Visualize"
                onClick={context.visualizeToggle}>
                remove_red_eye
        </button> );


}


